def choose_profile(p_list, W_needed=None, EI_needed=None, f_y=235):

    r_list = []

    for p in reversed(p_list):
        if p.Wy_el >= W_needed:

            r_list.append(p)

    r_list.sort(key=lambda x: x.g)

    if r_list:
        prof = r_list[0]

        p_list_2 = []
        for p in r_list:
            if p.E * p.I_y >= EI_needed:
                p_list_2.append(p)

        p_list_2.sort(key=lambda x: x.g)
        if p_list_2:
            prof = p_list_2[0]
        else:
            prof = HEB_1000
    else:
        prof = HEB_1000

    print()
    print('M_max, analytical: ' + str(round(W_needed * f_y * 10**-6, 2))
          + ' kNm')
    print('W_needed: ' + str(round(W_needed, 2)) + ' mm^3')
    print('EI_needed: ' + str(round(EI_needed, 2)) + ' Nmm^2')
    print('designation: ' + str(prof.designation))
    print('weight: ' + str(round(prof.g * 1000, 2)) + ' kg/m')
    print()

    if p_list_2:
        if len(p_list_2) > 6:
            print('other possible profiles:')
            for p in p_list_2[1:6]:
                print(p.designation)
        else:
            if len(p_list_2) > 1:
                print('other possible profiles:')
                for p in p_list_2[1:]:
                    print(p.designation)
    print()

    return prof, p_list_2
